    true,nt"url": null,nt"notes": "A system of records is a file, database,
    or program from which personal information is retrieved by name or other personal
    identifier. The Privacy Act provides a number of protections for your personal information.
    These typically include how information is collected, used, disclosed, stored, and
    disposed.rnAs part of our privacy policy, VA conducts an annual review of our Privacy
    Act system of record notices to make sure that they are current and republishes
    those that require changes or updates.rnPlease select the link to download the excel
    spreadsheet via the link labeled:   'Privacy Act System of Record'.rnThe spreadsheet
    contains the following fields:  SOR #, PUB DATE, CITATION, HYPERLINK TO FEDERAL
    REGISTER, SYSTEM TITLE,  and POC.",nt"license_title": "U.S. Government Work",nt"extras":
